import './App.css';
import Login from './components/Login'
import Doctor from './components/doctor/Doctor'
import Patient from './components/doctor/Patient';
import DoctorEdit from './components/doctor/DoctorEdit'
import Receptionist from './components/receptionist/Receptionist'
import ReceptionEdit from './components/receptionist/ReceptionEdit'
import HR from './components/human-resource/HR'
import Employee from './components/human-resource/Employee'
import HREdit from './components/human-resource/HREdit'
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

function App() {
  return (
    <div className="App">
      {/* <Doctor/> */}
      {/* <Patient/> */}
      {/* <DoctorEdit/> */}
      {/* <ReceptionistItem/> */}
      {/* <Receptionist/> */}
      {/* <ReceptionEdit/> */}
      {/* <HRItem/> */}
      {/* <HR/> */}
      {/* <Employee/> */}
      {/* <HREdit/> */}

      <Router>
        <Routes>
          <Route exact path="/" component={<Login/>} />
          <Route path="/doctor" component={<Doctor/>} />
          <Route path="/patient" component={<Patient/>} />
          <Route path="/edit/doctor" component={<DoctorEdit/>} />
          <Route path="/reception" component={<Receptionist/>} />
          <Route path="/edit/reception" component={<ReceptionEdit/>} />
          <Route path="/hr" component={<HR/>} />
          <Route path="/employee" component={<Employee/>} />
          <Route path="/edit/hr" component={<HREdit/>} />
        </Routes>
      </Router>

    </div>
  );
}

export default App;
